DESCRIPTION:
Brokas nutiestame naujame dviračių take ties požeminės perėjos įėjimų-išėjimų atkarpoje:
1) pačio tako pradžioje labai susibangavęs asfaltas;
2) ties &#34;2&#34; įėjimu į požeminę perėją taip pat dar didesnis asfalto susibangavimas;
3) traktoriaus ratų gilios žymės ant dviračių tako asfalto toje pačioje atkarpoje

