Sunkiasvorė transporto priemone (fura) stovi Vakarinėje gatvėje (prie Svajonių g.2 namo, ant važiuojamosios dalies Vakarinėje gatvėje), važiuoti šioje gatvėje, fūroms draudžiama, gatvė labai siaura, aplink nuosavi namai, nėra pesciuju takeliu. Apie tai informuojantys ženklai (draudimo vaziuoti) yra pastatyti gatvės pradžioje ir pabaigoje. Fūra trukdo matomumui, negalima įsuktį į kitas gatves.
